import PostsContainer from "../containers/PostsContainer";
import styled from "styled-components";

const Header = styled.h1`
  text-align: center;
  margin: 15px 0px;
  text-transform: uppercase;
  font-size: 52px;
`;
const Index = () => (
  <div>
    <Header>Posts</Header>
    <PostsContainer />
  </div>
);

export default Index;
